CREATE DEFINER=`root`@`localhost` PROCEDURE `login`(
OUT result BOOL, 
IN username VARCHAR(40), 
IN pwd VARCHAR(16))
BEGIN  
call checkPwd(result, username, pwd);
IF result THEN
update Users set lastlogin=CURRENT_TIMESTAMP 
where uname = username;
END IF; 
END ;;
